import React, { useState } from 'react';
import { Navbar, Nav, Container } from 'react-bootstrap';
import AcademicsPopup from './components/AcademicsPopup';
import FacultyPopup from './components/FacultyPopup';
import ResearchPopup from './components/ResearchPopup';
import AdmissionsPopup from './components/AdmissionsPopup';
import FacilitiesPopup from './components/FacilitiesPopup';
import StudentsPopup from './components/StudentsPopup';
import HostelsPopup from './components/HostelsPopup';
import AboutPopup from './components/AboutPopup';
import NewsPopup from './components/NewsPopup';

function CustomNavbar({ stickyClass, navbarOpacity }) {
  const [showPopup, setShowPopup] = useState({
    academics: false,
    faculties: false,
    research: false,
    admissions: false,
    facilities: false,
    studentsLife: false,
    news: false,
    hostels: false,
    about: false
  });

  const togglePopup = (menu, status) => setShowPopup({ ...showPopup, [menu]: status });

  return (
    <Navbar expand="lg" className={`w-100 ${stickyClass || 'position-absolute'}`} style={{ opacity: navbarOpacity }}>
      <Container>
        <Navbar.Toggle aria-controls='basic-navbar-nav' />
        <Navbar.Collapse id='basic-navbar-nav'>
          <Nav className='me-auto justify-content-center w-100'>
            {/* Academics Popup */}
            <div className='nav-item' onMouseEnter={() => togglePopup('academics', true)} onMouseLeave={() => togglePopup('academics', false)}>
              <span className='text-uppercase'>Academics</span>
              {showPopup.academics && <AcademicsPopup />}
            </div>

            {/* Faculty Popup */}
            <div className='nav-item' onMouseEnter={() => togglePopup('faculties', true)} onMouseLeave={() => togglePopup('faculties', false)}>
              <span className='text-uppercase'>Faculties</span>
              {showPopup.faculties && <FacultyPopup />}
            </div>

            {/* Repeat for other nav items */}
            {/* Research */}
            <div className='nav-item' onMouseEnter={() => togglePopup('research', true)} onMouseLeave={() => togglePopup('research', false)}>
              <span className='text-uppercase'>Research</span>
              {showPopup.research && <ResearchPopup />}
            </div>

            {/* Admissions */}
            <div className='nav-item' onMouseEnter={() => togglePopup('admissions', true)} onMouseLeave={() => togglePopup('admissions', false)}>
              <span className='text-uppercase'>Admissions</span>
              {showPopup.admissions && <AdmissionsPopup />}
            </div>

            {/* Facilities */}
            <div className='nav-item' onMouseEnter={() => togglePopup('facilities', true)} onMouseLeave={() => togglePopup('facilities', false)}>
              <span className='text-uppercase'>Facilities</span>
              {showPopup.facilities && <FacilitiesPopup />}
            </div>

            {/* Students Life */}
            <div className='nav-item' onMouseEnter={() => togglePopup('studentsLife', true)} onMouseLeave={() => togglePopup('studentsLife', false)}>
              <span className='text-uppercase'>Student Life</span>
              {showPopup.studentsLife && <StudentsPopup />}
            </div>

            {/* Hostels */}
            <div className='nav-item' onMouseEnter={() => togglePopup('hostels', true)} onMouseLeave={() => togglePopup('hostels', false)}>
              <span className='text-uppercase'>Hostels & Accommodations</span>
              {showPopup.hostels && <HostelsPopup />}
            </div>

              {/* News */}
              <div className='nav-item' onMouseEnter={() => togglePopup('about', true)} onMouseLeave={() => togglePopup('about', false)}>
              <span className='text-uppercase'>News</span>
              {showPopup.about && <NewsPopup />}
            </div>

            {/* About */}
            <div className='nav-item' onMouseEnter={() => togglePopup('about', true)} onMouseLeave={() => togglePopup('about', false)}>
              <span className='text-uppercase'>About</span>
              {showPopup.about && <AboutPopup />}
            </div>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default CustomNavbar;
